import React from 'react';
import '../createnote.css';
import Button from '@material-ui/core/Button';
import AddBoxIcon from '@material-ui/icons/AddBox';

const Createnote = () => {
    return(
        <>
        <div className='create-note'>
        <form>
            <input type='text' placeholder='Title' className='title-txt' autoComplete='off'/>
            <Button className='ad-btn'><AddBoxIcon className='add-btn' /></Button>
            <br/>
            <textarea placeholder='Note it down...' className='note-txt' autoComplete='off'/>
            {/* <textarea rows='' column='' placeholder='Note it down...' /> */}
            
        </form>
        

        </div>
        </>
    );
};




export default Createnote;
